def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True

def all_right_truncatable_prime(numbers):
    x = numbers[88]
    results = []

    for i in range(2, x):
        if is_prime(i):
            n = i
            while n > 9:
                n = int(str(n)[:-1])
                if not is_prime(n):
                    break
            else:
                results.append(i)

    return sorted(results)
```
Note: The code assumes that the tuple `numbers` will always have at least 89 elements to avoid any runtime errors.
